import React, { Component } from 'react';
import { Parallax } from 'react-scroll-parallax';
import './Form.css';

const Form = () => {
  return(
  <div>
    <form 
    name="contact"
    method="post"
    data-netlify="true"
    data-netlify-honeypot="bot-field"
     >
      <input name="name" placeholder="Your name" type="text"></input>
      <button>Send</button>
    </form>
  </div>

  )
}
export default Form
